import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const IntroSlideshow = () => {
  const navigate = useNavigate();

  useEffect(() => {
    const timer = setTimeout(() => {
      navigate('/home'); // Navigating to the home page after the slideshow
    }, 3000); // Adjust the duration to match your desired slideshow length

    return () => clearTimeout(timer); // Cleanup the timer on component unmount
  }, [navigate]); // Add navigate to the dependency array

  return (
    <div className="slideshow-container">
      <h1>Hi</h1>
      {/* Add your slideshow code here */}
    </div>
  );
};

export default IntroSlideshow;
